(2, 5, 0, 'مجلس به دانش آشتیانی هم رای اعتماد نداد', 'نمایندگان مجلس شورای اسلامی به فخرالدین احمدی‌ دانش‌آشتیانی برای تصدی وزارت علوم، تحقیقات و فناوری رای اعتماد ندادند.\n\nبه گزارش عصرایران، نمایندگان مجلس شورای اسلامی در جلسه علنی امروز خود برنامه‌های "فخرالدین احمدی دانش آشتیانی" را مورد بررسی قرار دادند و در نهایت به این وزیر پیشنهادی دولت برای تصدی وزارت علوم، تحقیقات و فناوری رأی اعتماد ندادند.مجلس به دانش آشتیانی هم رای اعتماد نداد\n\nبدین ترتیب، وزیر پیشنهادی علوم از مجموع 257 آرای مأخوذه با کسب 70 رأی موافق، 171 رأی مخالف و 16رأی ممتنع، نتوانست عضو کابینه شود.\n\nحجت‌الاسلام روحانی رئیس‌جمهور کشورمان روز سه‌شنبه هفته گذشته در نامه‌ای به علی لاریجانی رئیس مجلس شورای اسلامی «فخرالدین احمدی‌دانش‌آشتیانی» را به عنوان وزیر پیشنهادی خود برای تصدی سکّان وزارت علوم، تحقیقات و فناوری، به منظور کسب رأی اعتماد به مجلس معرفی کرد.\n\nرئیس‌جمهور پیش از این «جعفر میلی‌منفرد»، «رضا فرجی‌دانا» و «محمود نیلی‌احمدآبادی» را به عنوان وزرای پیشنهادی علوم به مجلس معرفی کرده بود که میلی‌منفرد نتواست از پارلمان رأی اعتماد بگیرد، اما فرجی‌دانا پس از کسب رأی اعتماد مجلس در آبان‌ماه سال گذشته تنها 10 ماه سکاندار این وزارتخانه بود چراکه وکلای ملت مردادماه سال جاری به دلیل انتصابات وی و عملکردش در این وزارتخانه رای اعتماد خود را پس گرفتند.\n\nپس از سلب اعتماد مجلس از فرجی‌دانا، محمدعلی نجفی به‌عنوان سرپرست وزارت علوم منصوب شد، اما پس از دو ماه از سرپرستی وی حجت‌الاسلام حسن روحانی رئیس‌جمهور در نامه‌ای به علی لاریجانی رئیس مجلس «محمود نیلی احمدآبادی» را به‌عنوان وزیر پیشنهادی دولت برای تصدی وزارت علوم، تحقیقات و فناوری به مجلس معرفی کرد و جلسه رأی اعتماد به وی 20 روز پیش یعنی 7 آبان در صحن علنی برگزار شد. نیلی‌احمدآبادی تنها موفق به کسب 79 رأی موافق در مقابل 160 رأی مخالف شد و نتوانست از فیلتر بهارستان بگذرد.', '0000-00-00 00:00:00', 0),
